import React from 'react'

const Style = {
  width : '50%',
  height : '50px',
  "border-radius" : '15px',
}
const Style2 = {
  width : '90%',
  margin : 'auto',
  "border-radius" : '15px',
}

export default function Home() {
  return (
    <div className='progress' style={Style2}>
    <div className='progress-bar' style={Style}>
      Hey
      </div>
    </div>
  )
};
